  main:
  
  	jal 	draw_menu
  	jal   draw_win_screen

    jal   draw_character

    jr    $ra

  ###   DRAWING SCREENS   ###

  draw_menu:

  # Load menu screen from .data section

    li    $t0,  BASE_ADDRESS
    la    $t1,  menu
    addi  $t3,  $zero,  1
    
  draw_menu_loop:

    lw    $t2,  0($t1)
    sw    $t2,  0($t0)

    addi  $t0,  $t0,  4
    addi  $t1,  $t1,  4
    addi  $t3,  $t3,  1

    bne   $t3,  16384,  draw_menu_loop    # 16384 is 128*128

    jr    $ra

  draw_win_screen:

  # Load win screen from .data section

    li      $t0,  BASE_ADDRESS
    la      $t1,  map
    addi    $t3,  $zero,  1

  draw_win_screen_loop:

    lw    $t2,  0($t1)
    sw    $t2,  0($t0)

    addi  $t0,  $t0,  4
    addi  $t1,  $t1,  4
    addi  $t3,  $t3,  1

    bne   $t3,  16384,  draw_menu_loop

    jr    $ra

  ### DRAWING THE MAP ###

  draw_map:

  draw_map_loop:

  ### DRAWING THE CHARACTER ###

  draw_character:

  # The character will take up 8 units of space,
  # we will need one procedure for every line.
  
    li    $t8,  char_pos
    li    $s0,  0x00FEAD00
    li    $s1,  0x00000000


  draw_line_1:

    sw    $s0,  4($t8)
    sw    $s0,  8($t8)
    sw    $s0,  12($t8)
    sw    $s0,  16($t8)
    sw    $s0,  20($t8)
    sw    $s0,  24($t8)
    sw    $s0,  28($t8)
    addi  $t8,  $t8,  512

  draw_line_2:

    sw    $s0,  0($t8)
    sw    $s0,  4($t8)
    sw    $s0,  8($t8)
    sw    $s0,  12($t8)
    sw    $s0,  16($t8)
    sw    $s0,  20($t8)
    sw    $s0,  24($t8)
    sw    $s0,  28($t8)
    sw    $s0,  32($t8)
    addi  $t8,  $t8,  512

  draw_line_3:

    sw    $s0,  0($t8)
    sw    $s0,  4($t8)
    sw    $s1,  8($t8)
    sw    $s0,  12($t8)
    sw    $s0,  16($t8)
    sw    $s0,  20($t8)
    sw    $s1,  24($t8)
    sw    $s0,  28($t8)
    sw    $s0,  32($t8)
    addi  $t8,  $t8,  512

  draw_line_4:

    sw    $s0,  0($t8)
    sw    $s0,  4($t8)
    sw    $s0,  8($t8)
    sw    $s0,  12($t8)
    sw    $s0,  16($t8)
    sw    $s0,  20($t8)
    sw    $s0,  24($t8)
    sw    $s0,  28($t8)
    sw    $s0,  32($t8)
    addi  $t8,  $t8,  512

  draw_line_5:

    sw    $s0,  0($t8)
    sw    $s0,  4($t8)
    sw    $s0,  8($t8)
    sw    $s0,  12($t8)
    sw    $s0,  16($t8)
    sw    $s0,  20($t8)
    sw    $s0,  24($t8)
    sw    $s0,  28($t8)
    sw    $s0,  32($t8)
    addi  $t8,  $t8,  512
  
  draw_line_6:

    sw    $s0,  0($t8)
    sw    $s0,  4($t8)
    sw    $s0,  8($t8)
    sw    $s0,  12($t8)
    sw    $s0,  16($t8)
    sw    $s0,  20($t8)
    sw    $s0,  24($t8)
    sw    $s0,  28($t8)
    sw    $s0,  32($t8)
    addi  $t8,  $t8,  512

  draw_line_7:

    sw    $s0,  0($t8)
    sw    $s0,  4($t8)
    sw    $s0,  8($t8)
    sw    $s0,  12($t8)
    sw    $s0,  16($t8)
    sw    $s0,  20($t8)
    sw    $s0,  24($t8)
    sw    $s0,  28($t8)
    sw    $s0,  32($t8)
    addi  $t8,  $t8,  512

  draw_line_8:

    sw    $s0,  4($t8)
    sw    $s0,  8($t8)
    sw    $s0,  12($t8)
    sw    $s0,  16($t8)
    sw    $s0,  20($t8)
    sw    $s0,  24($t8)
    sw    $s0,  28($t8)
    addi  $t8,  $t8,  -3584

    jr    $ra

  erase_character:

  # Free up the memory the character is using

    li    $t7,  0

    addi  $t8,  $zero,  -4
    addi  $t8,  $zero,  -8
    addi  $t8,  $zero,  -12
    addi  $t8,  $zero,  -16
    addi  $t8,  $zero,  -20
    addi  $t8,  $zero,  -24
    addi  $t8,  $zero,  -28
    addi  $t8,  $zero,  -32
    
    addi  $t8,  $t8,    512
    addi  $t7,  $t7,    1
    bne   $t7,  64,     erase_character

    jr    $ra

  move_character:

  # Erase character, change position, redraw erase_character
  # Four functions for each direction

  move_left:

    jal   erase_character
    addi  $t8,  $t8,  -8
    jal   draw_character
    
    jr    $ra
    

  move_right:

  move_up:

  move_down:

  ### TARGETS ###

  generate_targets:

  # Create randomly placed dots the character must capture

  target_captured:

  # Increase character score by 1. If 5 captured, generate win screen.
  # We know of capture if char_pos == target_pos.

  ### INPUT ###

  read_input:

  # Read from keyboard, move/select accordingly

    li 	  $t0, 	0xffff0000   # Receiver Control register address
		li 	  $t1, 	0xffff0004   # Receiver Data register address

	read_input_loop:

		lw    $t2,  0($t0)      # Read Receiver Control register
		andi  $t2,  $t2,  1     # Mask out Ready bit
		beqz  $t2,  read_input_loop
    beq   $t2,  104,  move_left
    beq   $t2,  106,  move_down
    beq   $t2,  107,  move_up
    beq   $t2,  108,  move_right
    beq   $t2,  10,   draw_map

    j     read_input_loop
